/*
 *****************************************************************************
 *  Purpose:        Handle a periodic rate iteration of the model.
 *  Returns:        void
 *  Notes:          None.
 *****************************************************************************
 */
void pkn_10ms_model_task(void)
{
  /* Update discrete events in multi-tasking mode.
   */
  real_T tnext = rt_UpdateDiscreteEvents(rtS);
  ssSetSolverStopTime(rtS, tnext);
  MdlOutputs(0);
  MdlUpdate(0);
  rt_UpdateDiscreteTaskTime(rtS, 0);
}

/*
 *****************************************************************************
 *  Purpose:        Handle a periodic rate iteration of the model.
 *  Returns:        void
 *  Notes:          None.
 *****************************************************************************
 */
void pkn_100ms_model_task(void)
{
  MdlOutputs(1);
  MdlUpdate(1);
  rt_UpdateDiscreteTaskTime(rtS, 1);
}
